import {useState, useEffect} from 'react'

function Home(){
  const [list, setList] = useState([])

  useEffect(() => {
    fetch("http://localhost:5001/api")
    .then(response => response.json())
    .then(list => setList(list))
  })

  return(
    <>
      <div>
        {
          list.map(item => (
            <div className='list_item'>
              <h3>{item[1]}</h3>
              <p>{item[2]}</p>
              {
                item[4] != null ? (
                  JSON.parse(item[4]).map(elem => (
                    <div>{elem.link}</div>
                  ))
                ) : (
                  <div></div>
                )
              }
            </div>
          ))
        }
      </div>
    </>
  )

}

export default Home;
